const Navbar = () => {
  return (
    <nav className="navbarItems">
      <h1 className="navbarLogo"> navbar logo</h1>
      <div className="menuIcon">
        <ul>
          {MenuItems.map((item, index) => {
            return (
              <Link href="/">
                <a>Back to home</a>
              </Link>
            );
          })}
        </ul>
      </div>
    </nav>
  );
};
export default Navbar;
